import { useEffect, useState } from 'react';
import axios from "axios"
import { format } from "date-fns";
import './App.css';


const baseUrl = "http://localhost:5000"



function App_old() {
  const [description, setDescription] = useState("");
  const [eventslist, setEventsList] = useState([]);

  const fetchEvents = async () => {
    const data = await axios.get('${ baseUrl }/events')
    //console.log("DATA: ", data) logs data to console, good for testing
    //setEventsList(events);
  }

  const handleChange = e => {
    setDescription(e.target.value)
  }

  const handleSubmit = e => {
    e.preventDefault();
    console.log(description);
  }

  useEffect(() => {
    fetchEvents(

    )
  }, [])
}

function Form() {
  const [cardName, setCardName] = useState('');
  const [cost, setCost] = useState('');
  const [cardClass, setCardClass] = useState('');
  const [cardType, setCardType] = useState('Artifact');
  const [alignment, setAlignment] = useState('Air');
  const [battlePoints, setBattlePoints] = useState('');
  const [healthPoints, setHealthPoints] = useState('');
  const [description, setDescription] = useState('');

  return (
    <main className="flex-container">
      <section className="keySpace"></section>
      <section className="genForm">
        <form>
          <div className="form-container">
            <label htmlFor="cardName">Name</label>
            <br />
            <input
              type="text"
              id="cardName"
              name="cardName"
              value={cardName}
              onChange={(e) => setCardName(e.target.value)}
            />
            <br />
          </div>
          <div className="form-container">
            <label htmlFor="PHcost">Cost</label>
            <input
              type="text"
              value={cost}
              onChange={(e) => setCost(e.target.value)}
            />
            <br />
          </div>
          <div className="form-container">
            <label htmlFor="PHclass">Class</label>
            <br />
            <input
              type="text"
              value={cardClass}
              onChange={(e) => setCardClass(e.target.value)}
            />
            <br />
          </div>
          <div className="form-container">
            <label htmlFor="cardType">Card Type</label>
            <select
              name="cardPicker"
              id="cardPicker"
              value={cardType}
              onChange={(e) => setCardType(e.target.value)}
            >
              <option value="Artifact">Artifact</option>
              <option value="Magic">Magic</option>
              <option value="Champion">Champion</option>
              <option value="Creature">Creature</option>
              <option value="Source">Source</option>
            </select>
            <br />
            <label htmlFor="PHalignment">Alignment</label>
            <br />
            <select
              name="alingmentPicker"
              id="alingmentPicker"
              value={alignment}
              onChange={(e) => setAlignment(e.target.value)}
            >
              <option value="Air">Air</option>
              <option value="Blood">Blood</option>
              <option value="Earth">Earth</option>
              <option value="Fire">Fire</option>
              <option value="Radiant">Radiant</option>
              <option value="Shadow">Shadow</option>
              <option value="Water">Water</option>
            </select>
            <div>
              <div className="form-container">
                <label htmlFor="statLine1">Battle Points</label>
                <br />
                <input
                  type="text"
                  className="statLine"
                  id="statLine1"
                  name="statLine1"
                  value={battlePoints}
                  onChange={(e) => setBattlePoints(e.target.value)}
                />
                <br />
                <label htmlFor="statLine2">Health Points</label>
                <br />
                <input
                  type="text"
                  className="statLine"
                  id="statLine2"
                  name="statLine2"
                  value={healthPoints}
                  onChange={(e) => setHealthPoints(e.target.value)}
                />
                <br />
              </div>
              <div className="form-container">
                <textarea
                  id="description"
                  name="description"
                  rows="10"
                  cols="35"
                  value={description}
                  onChange={(e) => setDescription(e.target.value)}
                >
                  Enter card text...
                </textarea>
              </div>
              <div className="buttonContainer">
                <button type="button" onClick={() => console.log('Save')}>
                  Save
                </button>
                <button type="button" onClick={() => console.log('Load')}>
                  Load
                </button>
                <button type="button" onClick={() => console.log('Clear')}>
                  Clear
                </button>
                <button type="button" onClick={() => console.log('Export')}>
                  Export
                </button>
              </div>
            </div>
          </div>
        </form>
      </section>
    </main>
  );
}


function CardImage() {
  return (
    <section className="genCard">
      <img src="images\cardmockupALPH1.png" alt="Placeholder Image" />
    </section>
  );


}


function App() {
  return (
    <div>
      <Form />
      <CardImage />
    </div>
  );
}

export default App;
